import "./App.css";
import Home from "./components/Home";
import { Route } from "react-router-dom";
import Checkout from "./components/Checkout";
function App() {
  return (
    <div className="App">
      <Route exact path="/">
        <Home />
      </Route>
      <Route exact path="/checkout">
        <Checkout />
      </Route>
    </div>
  );
}

export default App;
